import styles from "./App.module.scss";
import { NavBar } from "./components/NavBar/NavBar";
import { HomePage} from "./containers/HomePage/HomePage";
import {AboutMePage} from "./containers/AboutMePage/AboutMePage";
import {ProjectsPage} from "./containers/ProjectsPage/ProjectsPage";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Redirect,
  Link,
} from "react-router-dom";


const App = () => {
  return (
    <>
    <Router>
      <body>
        <header>
        <Link to ="/HomePage" className={styles.brandname}>C<span className={styles.brandname__tiny}>ara</span>
        T<span className={styles.brandname__tiny}>ran</span></Link>
        </header>
        <Switch>
          <Route exact path="/">
          <Redirect to="/HomePage" />
          </Route>
          <Route exact path="/HomePage">
              <HomePage />
            </Route>
            <Route exact path="/ProjectsPage">
              <ProjectsPage />
            </Route>
            <Route exact path="/AboutMePage">
              <AboutMePage />
            </Route>
        </Switch>
      </body>
      </Router>
    </>
  );
};

export default App;
